  false,\n\t\"url\": null,\n\t\"notes\": \"This document contains a map of local ecotype
  seed harvest zones for Iowa and Minnesota.  A local ecotype zone is defined as a
  geographic area with generally similar environmental characteristics and plant and
  animal species associations, and within which genetic characteristics are likely
  to be similar.  The ecotype zones for Iowa and Minnesota were developed based on
  plant community, landform, and climate characteristics, as well as ecological characteristics
  associated with latitude.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
